var UI_Next = "";
var UI_Mode = "Ferry:";
const X = 0, Y = 80;
var GPS = 0;
var UI_ETA = "";

var __lat;
var __long;
var __speed;



function draw() {
  g.clear();
  g.reset();
  g.setFont("Dylex7x13", 2);


  //var d = new Date();
  //var h = new Date().getHours(), m = new Date().getMinutes();
  var time = (" " + new Date().getHours()).substr(-2) + ":" + ("0" + new Date().getMinutes()).substr(-2);

  g.drawString("GPS:", X, Y - 40);
  g.drawString(GPS, X + 60, Y - 40, true);

  g.drawString("Time :", X, Y);
  g.drawString(time, X + 80, Y, true);

  g.drawString("Next " + UI_Mode, X, Y + 80);
  g.drawString(UI_Next, X + 130, Y + 80, true);

  g.drawString("ETA:", X, Y + 120);
  g.drawString(UI_ETA, X + 60, Y + 120, true);

  //Bangle.loadWidgets();
  Bangle.drawWidgets();

}



function updateNext(buffer) {
  UI_Next = "";
  //Terminal.println(buffer);
  for (var i = 0; i < buffer.length; i++) {
    UI_Next += String.fromCharCode(buffer[i]);
  }
  //Terminal.println(UI_Next);

  draw();
}

function updateETA(buffer) {
  UI_ETA = "";
  //Terminal.println(buffer);
  for (var i = 0; i < buffer.length; i++) {
    UI_ETA += String.fromCharCode(buffer[i]);
  }
  //Terminal.println(UI_ETA);
  draw();
}

//updates services with last know values to trigger an update
function forceUpdate(){
  NRF.updateServices({
    "9453F387-D59C-4F48-8B00-E821AB37DE96": {
      "2C1743A7-D387-4702-914D-33664446BFF0": {
        value: __lat,
      }
    }
  });

  NRF.updateServices({
    "9453F387-D59C-4F48-8B00-E821AB37DE96": {
      "DAB04CC7-4683-4587-B667-202141125656": {
        value: __long,
      }
    }
  });

  NRF.updateServices({
    "9453F387-D59C-4F48-8B00-E821AB37DE96": {
      "BCEA6754-A22D-45FA-BB0F-A497EE0639BD": {
        value: __speed,
      }
    }
  });

}


function onGPS(fix) {
  hasfix = fix.fix;
  if (hasfix) {
    round = 5;
    let lat = fix.lat.toFixed(round);
    let long = fix.lon.toFixed(round);
    let speed = fix.speed.toFixed(round);
    if (GPS == 0) {
      GPS = 1;
      draw();
    }

    __lat = lat;
    __long = long;
    __speed = speed;


    NRF.updateServices({
      "9453F387-D59C-4F48-8B00-E821AB37DE96": {
        "2C1743A7-D387-4702-914D-33664446BFF0": {
          value: lat,
        }
      }
    });

    NRF.updateServices({
      "9453F387-D59C-4F48-8B00-E821AB37DE96": {
        "DAB04CC7-4683-4587-B667-202141125656": {
          value: long,
        }
      }
    });

    NRF.updateServices({
      "9453F387-D59C-4F48-8B00-E821AB37DE96": {
        "BCEA6754-A22D-45FA-BB0F-A497EE0639BD": {
          value: speed,
        }
      }
    });

  }
}


