function init() {
  g.clear();
  Bangle.setGPSPower(1);
  initServices();
  Bangle.on('GPS', onGPS);
  Bangle.loadWidgets();
  draw();
  
  //var timestampInterval = setInterval(updateTime, 1000);


  setWatch(() => {
    draw();
  }, BTN1, { repeat: true });

  // Show launcher when middle button pressed
  setWatch(Bangle.showLauncher, BTN2, { repeat: false, edge: "falling" });

  setWatch(() => {
    forceUpdate();
  }, BTN3, { repeat: true });
}


init();